INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, 'Copyright 2013 <span>classic</span> | All Rights Reserved | Powered by <a href="http://drupal.org/">Drupal</a>  |  <a href="http://drupalchamp.com">Drupalchamp</a>', 'Copyright', 'full_html'),
(2, '<p><a href="#" class="button button-large button-right">Purchase</a></p>\r\n<h2>Looking for a professional and unique responsive drupal theme?</h2>\r\n<p>Classic is simple and clean responsive drupal theme suitable for companies wishing to create the profile of their web presence, it''s created by using the latest HTML5 and CSS3 techniques.</p>', 'Looking for a professional and unique responsive drupal theme?', 'full_html'),
(3, '<dl><dd class="address">C-244, 2nd Floor, Sector-63, Noida, India.</dd>\r\n<dd class="phone">Telephone: 0120-42-81666</dd>\r\n<dd class="fax">FAX:  0120-42-81666</dd>\r\n<dd class="email">E-mail: <a href="info@drupalchamp.com">info@drupalchamp.com</a></dd>\r\n</dl>', 'Contact Info', 'full_html'),
(4, ' Lorem ipsum dolor sit amet, ctetuer adipiscing elit, sed diamnt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat.', 'Who are we', 'full_html'),
(5, '<p>[accordion]</p>\r\n<h3 id="accordion-section-i">Our Company Mission</h3>\r\n<p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas.</p>\r\n<ul>\r\n<li>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.</li>\r\n<li>Aliquam tincidunt mauris eu risus.</li>\r\n</ul>\r\n<h3 id="accordion-section-ii">Company Philosophy</h3>\r\n<p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, leo.</p>\r\n<ul>\r\n<li>Aliquam tincidunt mauris eu risus.</li>\r\n<li>Vestibulum auctor dapibus neque.</li>\r\n</ul>\r\n<h3 id="accordion-section-iii">Our Company Vision</h3>\r\n<p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac eu libero sit amet quam egestas semper.</p>\r\n<ul>\r\n<li>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.</li>\r\n<li>Aliquam tincidunt mauris eu risus.</li>\r\n</ul>\r\n<p>[/accordion]</p>', 'Accordion Widget', 'jquery_ui_filter'),
(6, '<p>[tabs]</p>\r\n<h3 id="tabs-section-i">Tab 1</h3>\r\n<p>Pellentesque Aenean ultricies mi vitae est. Mauris placerat eleifend leo.</p>\r\n<ul>\r\n<li>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.</li>\r\n<li>Aliquam tincidunt mauris eu risus.</li>\r\n</ul>\r\n<h3 id="tabs-section-ii">Tab 2</h3>\r\n<p>Pellentesque habitant morbi tristiquevitae est. Mauris placerat eleifend leo.</p>\r\n<ul>\r\n<li>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.</li>\r\n<li>Vestibulum auctor dapibus neque.</li>\r\n</ul>\r\n<h3 id="tabs-section-iii">Tab 3</h3>\r\n<p>Pellentesque habitant morbi tristique senectacerat eleifend leo.</p>\r\n<ul>\r\n<li>Aliquam tincidunt mauris eu risus.</li>\r\n<li>Vestibulum auctor dapibus neque.</li>\r\n</ul>\r\n<p>[/tabs]</p>', 'Tab Widget', 'jquery_ui_filter'),
(7, '<p>Quisque ligulas ipsum, euismod atras vulputate iltricies etri elit. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos.</p>', 'Basic Text Widget', 'full_html'),
(8, '<dl><dd class="address">C-244, 2nd Floor, Sector-63, Noida, India.</dd><dd class="phone">Telephone: 0120-42-81666</dd><dd class="fax">FAX: 0120-42-81666</dd><dd class="email">E-mail: <a href="info@drupalchamp.com">info@drupalchamp.com</a></dd></dl>', 'How To Find Us', 'full_html'),
(9, '<p><span class="phone"> +0120-42-81666 | info@domain.com</span></p>', 'Contact number', 'full_html'),
(10, '<a href="#" class="button button-large button-right">Purchase</a>\r\n<h2>Great Multipurpose Drupal Responsive Theme!</h2>\r\n<p>We truly care about our users and our product. Which is why we are constantly improving Classic for our beloved users.</p>', 'Purchase Now', 'full_html'),
(11, '<div class="skill-title">HTML 5</div><div class="skillbar" data-perc="90"><div class="skill-percentage" style="width: 90%;">&nbsp;</div></div><div class="skill-title">CSS 3</div><div class="skillbar" data-perc="65"><div class="skill-percentage" style="width: 65%;">&nbsp;</div></div><div class="skill-title">jQuery</div><div class="skillbar" data-perc="70"><div class="skill-percentage" style="width: 70%;">&nbsp;</div></div><div class="skill-title">Photoshop</div><div class="skillbar" data-perc="85"><div class="skill-percentage" style="width: 85%;">&nbsp;</div></div><div class="skill-title">Dreamweaver</div><div class="skillbar" data-perc="90"><div class="skill-percentage" style="width: 90%;">&nbsp;</div></div><div class="skill-title">SEO</div><div class="skillbar" data-perc="80"><div class="skill-percentage" style="width: 80%;">&nbsp;</div></div>', 'Skill bar', 'full_html'),
