('node', 'page', 0, 53, 53, 'und', 0, '<div class="col-one-fourth"><img src="http://classic.drupalchamp.com/sites/default/files/pic-2.jpg" />\r\n<h3>100% Ultra Responsive</h3>\r\n<p>Avada is fully responsive and can adapt to any screen size, its incredibly fast and super flexible.</p>\r\n</div>\r\n<div class="col-one-fourth"><img src="http://classic.drupalchamp.com/sites/default/files/pic-3.jpg" />\r\n<h3>Amazingly Cool Sliders</h3>\r\n<p>Avada includes the awesome Layer Slider, Revolution Slider as well as the ever popular FlexSlider2.</p>\r\n</div>\r\n<div class="col-one-fourth"><img src="http://classic.drupalchamp.com/sites/default/files/pic-4.jpg" />\r\n<h3>Advanced Admin Area</h3>\r\n<p>Avada includes an advanced admin panel making it fun and very easy to customize your theme.</p>\r\n</div>\r\n<div class="col-one-fourth col-last"><img src="http://classic.drupalchamp.com/sites/default/files/pic-5.jpg" />\r\n<h3>Loaded With Options</h3>\r\n<p>This theme is loaded with options and we are constantly updating Avada with new features.</p>\r\n</div>', '', 'full_html'),
