('node', 'page', 0, 55, 55, 'und', 0, '<h3>Adaptive Design</h3>\r\n<p>Classic theme is fully responsive theme using media queries. Classic is mobile first responsive theme.</p>\r\n<figure class="image"><img src="http://classic.drupalchamp.com/sites/default/files/responsive-layout.jpg" /></figure>', '', 'full_html'),
('node', 'thumb_slideshow_banner', 0, 83, 83, 'und', 0, '<h2>BANNNER TITLE</h2>\r\n<p>Lorem ipsum dolor sit amet, consectetur. <br />Nam viverra euismod odio.</p>', '', 'full_html'),
('node', 'thumb_slideshow_banner', 0, 82, 82, 'und', 0, '<p>Ut wisi enim ad minim veniam, quis <br />nostrud exerci tation ullamcorpe<br />wisi enim ad minim veniam, quis <br />nostrud exerci tation ullamcorpe</p>', '', 'full_html'),
('node', 'thumb_slideshow_banner', 0, 81, 81, 'und', 0, '<h2>Nam viverra euismod</h2>\r\n<p>Lorem ipsum dolor sit amet, consectetur<br />adipiscing elit. Nam viverra euismod odio.</p>\r\n<p><a class="button" href="#">Read More...</a></p>', '', 'full_html');
INSERT INTO `field_data_comment_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`) VALUES
('comment', 'comment_node_blog', 0, 1, 1, 'und', 0, 'We recently discovered notfound.org, a noble initiative to turn website''s 404-pages to good use. Their goal is to have websites implement an iframe on their 404-pages, an iframe in which, in collaboration with i.a. Child Focus, pictures of missing people/children along with their description are displayed.', 'filtered_html'),
('comment', 'comment_node_blog', 0, 2, 2, 'und', 0, 'Widgets are items you can link to a block on a page. An example of a widget is a content-block. In this article we''ll explain how to create your own widget that shows the last 5 tweets of your Twitter-account. We assume you have the basic fork installation covered.', 'full_html'),
('comment', 'comment_node_blog', 0, 3, 3, 'und', 0, 'The name I choose for the widget is stream. I choose this name because in the future we can expand the module with new widgets, actions, ... So, the code for a widget is placed in a file with the same name as the widget. So create a file stream.php', 'full_html'),
('comment', 'comment_node_blog', 0, 4, 4, 'und', 0, 'Quisque ligulas ipsum, euismod atras vulputate iltricies etri elit. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Nulla nunc dui, tristique in semper vel, congue sed ligula. \r\nNam dolor ligula, faucibus id sodales in, auctor fringilla libero. Pellentesque pellentesque tempor tellus eget hendrerit. Morbi id aliquam ligula. Aliquam id dui sem. Proin rhoncus consequat nisl, eu ornare mauris tincidunt.\r\nClassic includes the awesome Layer Parallax Slider as well as the popular FlexSlider2. Both are easy to use!\r\n', 'full_html'),
('comment', 'comment_node_blog', 0, 5, 5, 'und', 0, 'Nulla nunc dui, tristique in semper vel, congue sed ligula. Nam dolor ligula, faucibus id sodales in, auctor fringilla libero. Pellentesque pellentesque tempor tellus eget hendrerit. ', 'filtered_html');
