INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, '<div class="col-one-fourth">\r\n<h3><i class="icon-laptop icon-large"></i> Responsive Design</h3>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam viverra euismod odio.</p>\r\n</div>\r\n<div class="col-one-fourth">\r\n<h3><i class="icon-leaf icon-large"></i> Clean Design</h3>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam viverra euismod odio.</p>\r\n</div>\r\n<div class="col-one-fourth">\r\n<h3><i class="icon-screenshot icon-large"></i> Easy Customization</h3>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam viverra euismod odio.</p>\r\n</div>\r\n<div class="col-one-fourth col-last">\r\n<h3><i class="icon-headphones icon-large"></i> 24/7 Live Support</h3>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam viverra euismod odio.</p>\r\n</div>', '', 'full_html'),
('node', 'page', 0, 2, 2, 'und', 0, '<h3>Layout Settings</h3>\r\n<p><img src="http://classic.drupalchamp.com/sites/default/files/classic-layout-pic.jpg" /></p>\r\n<h3>Color Settings</h3>\r\n<p><img src="http://classic.drupalchamp.com/sites/default/files/classic-color-schemes-pic.jpg" /></p>\r\n<h3>Breadcrumb Settings</h3>\r\n<p><img src="http://classic.drupalchamp.com/sites/default/files/classic-breadcrumb-pic.jpg" /></p>\r\n<h3>Layout Settings</h3>\r\n<p><img src="http://classic.drupalchamp.com/sites/default/files/classic-layout-pic.jpg" /></p>\r\n<h3>Font Settings</h3>\r\n<p><img src="http://classic.drupalchamp.com/sites/default/files/classic-font-pic.jpg" /></p>', '', 'full_html'),
('node', 'blog', 0, 3, 3, 'und', 0, '<p>Because of the lack of documentation, and multiple people were asking how to execute custom code on the frontend, I wrote a brief howto on creating widgets on the frontend.</p>\r\n<p>Widgets are items you can link to a block on a page. An example of a widget is a content-block. In this article we''ll explain how to create your own widget that shows the last 5 tweets of your Twitter-account. We assume you have the basic fork installation covered.</p>\r\n<h2>Creating the widget</h2>\r\n<p>A widget can only live inside a module, so if you don''t have a module yet, you should create one. Creating a module isn''t that hard:</p>\r\n<p>First we will insert a new module in the modules-table, which can be done by executing the query below</p>\r\n<pre><code>INSERT INTO modules(name, description, active) VALUES (''twitter'', NULL, ''Y'');</code></pre><p>Use the translations-module to add the translation for your module name. In the example we will need to add an label with the reference code "Twitter". Once that is done, we should set the permissions</p>\r\n<pre><code>INSERT INTO groups_rights_modules(id, group_id, module) VALUES (NULL, 1, ''twitter'');</code></pre><p>All database stuff is done, so fire up your favourite PHP-editor.</p>\r\n<p>Open up the default_www/frontend/modules-folder and create a new folder with the same name as the module you inserted into the database, in our example we create a folder called twitter.</p>\r\n<p>Each module has the same structure in Fork, so we need to create some basic folder and files.</p>\r\n<h3>The configuration file</h3>\r\n<p>Each module must have a configuration file, which defines some options. The file looks the same across the modules, except for the class name.</p>\r\n<p>The class name is always build like this: Frontend<em>CamelCasedModuleName</em>Config, in our example the class name will be FrontendTwitterConfig. You can copy/paste the code below.</p>\r\n<pre><code><span style="color: #0000bb;">&lt;?php</span><br /><br /><span style="color: ff8000;">/**<br /> * This is the configuration-object<br /> *<br /> * @package</span></code>	<code><span style="color: #000000;"><span style="color: #ff8000;">frontend<br /> * @subpackage</span></span></code>	<code><span style="color: #000000;"><span style="color: #ff8000;">twitter<br /> *<br /> * @author</span></span></code>	<code><span style="color: #000000;"><span style="color: #ff8000;">Tijs Verkoyen <tijs@sumocoders.com><br /> * @since</tijs@sumocoders.com></span></span></code>	<code><span style="color: #000000;"><span style="color: #ff8000;"><tijs@sumocoders.com>2.6<br /> */<br /></tijs@sumocoders.com></span><span style="color: #007700;">final class </span><span style="color: #0000bb;">FrontendTwitterConfig </span><span style="color: #007700;">extends </span><span style="color: #0000bb;">FrontendBaseConfig<br /></span><span style="color: #007700;">{<br />}<br /><br /></span><span style="color: #0000bb;">?&gt;</span></span></code></pre>\r\n<p>Because our widget doesn''t have any configuration stuff, it''s just an empty class. The functionality is extended from the base config class.</p>\r\n<h3>The code for the widget</h3>\r\n<p>Of course, our widget will need some code to grab the tweets, or to authenticate if needed.</p>\r\n<p>In a module we have different types of code: actions, ajax, model, widgets. For this how-to, we just need widgets, so we will create a folder called widgets in the module.</p>\r\n<p>The name I choose for the widget is <em>stream</em>. I choose this name because in the future we can expand the module with new widgets, actions, ... So, the code for a widget is placed in a file with the same name as the widget. So create a file <em>stream.php</em></p>\r\n<p>Copy/paste the code below. The code is documented inline.</p>\r\n<p>Go to the pages-modules and edit the page on which you would like the widget to appear, and link the widget to the correct place.</p>\r\n<p>In the dialog, select widget as type, choose the module (Twitter) you created in the second dropdownmenu. In the third dropdownmenu you can select your newly created widget (Stream).</p>\r\n<p>Once you save the page, the widget is linked. If you open up the page you will be redirect to Twitter to authorize the application (the oAuth-dance), if you authorized the application, you will see your tweets on the page.</p>\r\n<p>That''s all folks, enjoy your widgets!</p>	', '', 'full_html'),
('node', 'blog', 0, 4, 4, 'und', 0, '<p>You don''t need to have any technical or design experience to easily create a beautiful online store.</p>\r\n<p>Simply choose a stylish ecommerce website design, easily customize your online store, add products, and you''re pretty much ready to accept payments. Got a question? Simply ask your very own Support Guru and they''ll be happy to help!&nbsp;</p>\r\n<p>Whether you already have products, are looking to sell digital goods or are interested in drop shipping — Shopify has a complete solution for you.</p>', '', 'full_html'),
