INSERT INTO `field_revision_comment_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `comment_body_value`, `comment_body_format`) VALUES
('comment', 'comment_node_blog', 0, 1, 1, 'und', 0, 'We recently discovered notfound.org, a noble initiative to turn website''s 404-pages to good use. Their goal is to have websites implement an iframe on their 404-pages, an iframe in which, in collaboration with i.a. Child Focus, pictures of missing people/children along with their description are displayed.', 'filtered_html'),
('comment', 'comment_node_blog', 0, 2, 2, 'und', 0, 'Widgets are items you can link to a block on a page. An example of a widget is a content-block. In this article we''ll explain how to create your own widget that shows the last 5 tweets of your Twitter-account. We assume you have the basic fork installation covered.', 'full_html'),
('comment', 'comment_node_blog', 0, 3, 3, 'und', 0, 'The name I choose for the widget is stream. I choose this name because in the future we can expand the module with new widgets, actions, ... So, the code for a widget is placed in a file with the same name as the widget. So create a file stream.php', 'full_html'),
