('comment', 'comment_node_blog', 0, 5, 5, 'und', 0, 'Nulla nunc dui, tristique in semper vel, congue sed ligula. Nam dolor ligula, faucibus id sodales in, auctor fringilla libero. Pellentesque pellentesque tempor tellus eget hendrerit. ', 'filtered_html');
