(1, 'node', ' responsive design lorem ipsum dolor sit amet consectetur adipiscing elit nam viverra euismod odio clean design lorem ipsum dolor sit amet consectetur adipiscing elit nam viverra euismod odio easy customization lorem ipsum dolor sit amet consectetur adipiscing elit nam viverra euismod odio 247 live support lorem ipsum dolor sit amet consectetur adipiscing elit nam viverra euismod odio  ', 0),
(2, 'node', ' recolorable with configuration layout settings color settings breadcrumb settings layout settings font settings ', 0),
(3, 'node', ' how to create a responsive theme himanshu s blog because of the lack of documentation and multiple people were asking how to execute custom code on the frontend i wrote a brief howto on creating widgets on the frontend widgets are items you can link to a block on a page an example of a widget is a contentblock in this article we ll explain how to create your own widget that shows the last 5 tweets of your twitteraccount we assume you have the basic fork installation covered creating the widget a widget can only live inside a module so if you don t have a module yet you should create one creating a module isn t that hard first we will insert a new module in the modulestable which can be done by executing the query below insert into modules name description active values twitter null y use the translationsmodule to add the translation for your module name in the example we will need to add an label with the reference code twitter once that is done we should set the permissions insert into groupsrightsmodules id groupid module values null 1 twitter all database stuff is done so fire up your favourite phpeditor open up the defaultwww frontend modulesfolder and create a new folder with the same name as the module you inserted into the database in our example we create a folder called twitter each module has the same structure in fork so we need to create some basic folder and files the configuration file each module must have a configuration file which defines some options the file looks the same across the modules except for the class name the class name is always build like this frontend camelcasedmodulename config in our example the class name will be frontendtwitterconfig you can copy paste the code below php this is the configurationobject package frontend subpackage twitter author tijs verkoyen since sumocoderscom 26 sumocoderscom final class frontendtwitterconfig extends frontendbaseconfig because our widget doesn t have any configuration stuff it s just an empty class the functionality is extended from the base config class the code for the widget of course our widget will need some code to grab the tweets or to authenticate if needed in a module we have different types of code actions ajax model widgets for this howto we just need widgets so we will create a folder called widgets in the module the name i choose for the widget is stream  i choose this name because in the future we can expand the module with new widgets actions so the code for a widget is placed in a file with the same name as the widget so create a file streamphp copy paste the code below the code is documented inline go to the pagesmodules and edit the page on which you would like the widget to appear and link the widget to the correct place in the dialog select widget as type choose the module twitter you created in the second dropdownmenu in the third dropdownmenu you can select your newly created widget stream once you save the page the widget is linked if you open up the page you will be redirect to twitter to authorize the application the oauthdance if you authorized the application you will see your tweets on the page that s all folks enjoy your widgets  drupal responsive html5 css3 design anonymous not verified mon 2112013 220 permalink we recently discovered we recently discovered notfoundorg a noble initiative to turn website s 404pages to good use their goal is to have websites implement an iframe on their 404pages an iframe in which in collaboration with ia child focus pictures of missing people children along with their description are displayed reply himanshu fri 2152013 1438 permalink widgets are items you can widgets are items you can link to a block on a page an example of a widget is a contentblock in this article we ll explain how to create your own widget that shows the last 5 tweets of your twitteraccount we assume you have the basic fork installation covered reply anonymous not verified thu 2212013 1622 permalink nulla nunc dui tristique in nulla nunc dui tristique in semper vel congue sed ligula nam dolor ligula faucibus id sodales in auctor fringilla libero pellentesque pellentesque tempor tellus eget hendrerit reply himanshu fri 2152013 1438 permalink the name i choose for the the name i choose for the widget is stream i choose this name because in the future we can expand the module with new widgets actions so the code for a widget is placed in a file with the same name as the widget so create a file streamphp reply ', 0),
(4, 'node', ' never sold online before it s easy himanshu s blog you don t need to have any technical or design experience to easily create a beautiful online store simply choose a stylish ecommerce website design easily customize your online store add products and you re pretty much ready to accept payments got a question simply ask your very own support guru and they ll be happy to help whether you already have products are looking to sell digital goods or are interested in drop shipping shopify has a complete solution for you drupal responsive html5 css3 himanshu fri 2152013 1439 permalink quisque ligulas ipsum  quisque ligulas ipsum euismod atras vulputate iltricies etri elit class aptent taciti sociosqu ad litora torquent per conubia nostra per inceptos himenaeos nulla nunc dui tristique in semper vel congue sed ligula nam dolor ligula faucibus id sodales in auctor fringilla libero pellentesque pellentesque tempor tellus eget hendrerit morbi id aliquam ligula aliquam id dui sem proin rhoncus consequat nisl eu ornare mauris tincidunt classic includes the awesome layer parallax slider as well as the popular flexslider2 both are easy to use  reply ', 0),
